import "./App.css";
import React from "react";
import Home from './pages/Home/index'
import Blog from './pages/Blog/index'
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
} from "react-router-dom";


const App = () => {
  return (
    <div className="container">
      <Router>
            <div className="App">
                <ul className="App-header">
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/blog">
                            Blog
                        </Link>
                    </li>
                </ul>
                <Routes>
                    <Route
                        exact
                        path="/"
                        element={<Home />}
                    ></Route>
                    <Route
                        exact
                        path="/blog"
                        element={<Blog />}
                    ></Route>
                </Routes>
            </div>
        </Router>
    </div>
  );
};

export default App;
